import './App.css';
import kpi_styles from './styles/KPI.module.css';
import mstyles from './styles/Main.module.css';

import Sidebar from './components/Sidebar';
import KPI from './components/KPI';
import LineChart from './components/LineChart';
import Transactions from './components/Transactions';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
      <Sidebar></Sidebar>
      <div className={`App grid`}>
        <Navbar></Navbar>

          <main className={`${mstyles.main}`}>
            <KPI 
              className={kpi_styles.net_worth} 
              name={'Net Worth'}
              value={1234}>
            </KPI>
            <KPI className={kpi_styles.inflow} name=''></KPI>
            <KPI className={kpi_styles.expenses}></KPI>

            <LineChart></LineChart>
            <Transactions></Transactions>
          </main>

      </div>
    </>
  );
}

export default App;

